import React from "react";

const Leaguetable = ({ data }) => {
  return (
    <>
      <div className="w-full h-full text-black flex">
        <div>
          <h1>Position</h1>
          <h1>Club</h1>
          <h1>Plyd</h1>
          <h1>Won</h1>
          <h1>Drwn</h1>
          <h1>lost</h1>
          <h1>GF</h1>
          <h1>GA</h1>
          <h1>GD</h1>
          <h1>Pnts</h1>
        </div>
      </div>
    </>
  );
};

export default Leaguetable;
